import React from "react";

export default function ResumeHobbies() {
  return (
    <div className="hobbies-skills">
      <h4>Hobbies</h4>
      <ul>
        <li>Mountain Climbing</li>
        <li>Coding</li>
        <li>Sketching</li>
        <li>Cycling</li>
        <li>Trading</li>
      </ul>
    </div>
  );
}
